def get_stats(symbol,stock_data):
    
    # print(type(stock_data))
    stock_data['name'] = symbol
    data = requests.get(f"https://api.twelvedata.com/statistics?symbol={symbol}&apikey=cfced1457b864e19a12ae43cde26b8fd").json()
    
    val = data["statistics"]["valuations_metrics"]
    stock_data["market_capitalization"] = val["market_capitalization"] 
    stock_data["enterprise_value"] = val["enterprise_value"] 
    stock_data["trailing_pe"] = val["trailing_pe"] 
    stock_data["forward_pe"] = val["forward_pe"] 
    
    val = data["statistics"]["financials"]
    stock_data["profit_margin"] = val["profit_margin"] 
    
    val = data["statistics"]["financials"]["income_statement"]
    stock_data["revenue_per_share_ttm"] = val["revenue_per_share_ttm"] 
    stock_data["quarterly_revenue_growth"] = val["quarterly_revenue_growth"] 
    stock_data["ebitda"] = val["ebitda"] 

    val = data["statistics"]["financials"]["balance_sheet"]
    stock_data["total_cash_per_share_mrq"] = val["total_cash_per_share_mrq"] 
    stock_data["total_debt_to_equity_mrq"] = val["total_debt_to_equity_mrq"] 

    val = data["statistics"]["stock_statistics"]
    stock_data["short_ratio"] = val["short_ratio"] 
    stock_data["percent_held_by_insiders"] = val["percent_held_by_insiders"] 
    stock_data["percent_held_by_institutions"] = val["percent_held_by_institutions"] 

    val = data["statistics"]["stock_price_summary"]
    stock_data["fifty_two_week_change"] = val["fifty_two_week_change"] 
    stock_data["day_50_ma"] = val["day_50_ma"] 
    stock_data["day_200_ma"] = val["day_200_ma"]  

    val = data["statistics"]["dividends_and_splits"]
    stock_data["trailing_annual_dividend_rate"] = val["trailing_annual_dividend_rate"] 
    stock_data["forward_annual_dividend_rate"] = val["forward_annual_dividend_rate"] 
    stock_data["5_year_average_dividend_yield"] = val["5_year_average_dividend_yield"] 
    stock_data["payout_ratio"] = val["payout_ratio"] 





