# generating context dictionary


def addTo_context(stock_dict,context_data,index):

    for field in stock_dict:

        if field=='name' or field=='sector':
            context_data[field][index].append(stock_dict[field])
        elif stock_dict[field]==None:
            stock_dict[field]=0
        else:
            context_data[field][index]+=float(stock_dict[field])


def finding_mean(context_data,div0,div1):

    # print(div0,div1)

    for field in context_data:
        # print(field)
        if field=='Stock1' or field=='Stock2'or field=='name' or field=='sector':
            continue
        else:
            # print(context_data[field][0],context_data[field][1])
            context_data[field][0]=round(context_data[field][0]/div0,5)
            context_data[field][1]=round(context_data[field][1]/div1,5)


def addColor(context_data):

    color = {}

    for field in context_data:

        color0 = field+"0"
        color1 = field+"1"

        if field=='name' or field=='sector':
            color[color0] = "white"
            color[color1] = "white"
        else:

            val0 =  context_data[field][0]
            val1 =  context_data[field][1]

            if val0 == val1:
                color[color0] = "white"
                color[color1] = "white"
            elif val0 > val1:
                color[color0] = "green"
                color[color1] = "red"
            else:
                color[color0] = "red"
                color[color1] = "green"

    for key in color:
        context_data[key] = color[key]


# generating context dictionary end


