def create_price(price_dict, time_series):

    # time_series = requests.get(f"https://api.twelvedata.com/time_series?symbol={symbol}&interval=1min&outputsize=5000&apikey=cfced1457b864e19a12ae43cde26b8fd").json()
    # print(time_series)

    data = {
        "high":[],
        "low":[],
        "open":[],
        "close":[],
        "price":[],
        "volume":[] 
    }

    for value in time_series["values"]:

        for field in value:

            if field!="datetime":
                data[field].append(float(value[field]))

        data["price"].append((float(value["open"])+float(value["close"]))/2)

    data["price"].reverse()


    for field in data:
        # print(field)
        # print(len(price_dict[field]))

        if(len(price_dict[field])==0):
            price_dict[field]=data[field]
        else:
            array1 = np.array(price_dict[field])
            array2 = np.array(data[field])
            array3 = array1 + array2
            list1 = list(array3)
            price_dict[field] = list1
