def generate_andPredict(data, name):
    
    df = pd.DataFrame(data)
    # print(df)


    grf_path = 'media\images\\' + name + "price"
    plt.figure(figsize=(12,6))
    plt.plot(df.price)
    plt.xlabel('Time(Days)')
    plt.ylabel('Price')
    plt.title(name + " Total Price")
    plt.savefig(grf_path)
    plt.clf() 
    # plt.show()
        

    ma100 = df.price.rolling(100).mean()
    ma100


    # plt.figure(figsize=(12,6))
    # plt.plot(df.price)
    # plt.plot(ma100,'r')

    ma200 = df.price.rolling(200).mean()
    ma200

    grf_path = 'media\images\\' + name + "mavg"
    plt.figure(figsize=(12,6))
    plt.plot(df.price)
    plt.plot(ma100,'r',label='100days moving average')
    plt.plot(ma200,'g',label='200days moving average')
    plt.title(name + " Moving Avrages")
    plt.xlabel('Time')
    plt.ylabel('Price')
    plt.savefig(grf_path)
    plt.clf() 
    # plt.show()



    data_training = pd.DataFrame(df['price'][0: int(len(df)*0.7)])
    data_testing = pd.DataFrame(df['price'][int(len(df)*0.7) : int(len(df))])

    # print(data_training.shape)
    # print(data_testing.shape)


    # from sklearn.preprocessing import MinMaxScaler
    scaler = MinMaxScaler(feature_range=(0,1))


    data_training_array = scaler.fit_transform(data_training)
    data_training_array
    data_training_array.shape


    x_train = []
    y_train = []

    for i in range(100, data_training_array.shape[0]):
        x_train.append(data_training_array[i-100:i])
        y_train.append(data_training_array[i,0])

    x_train, y_train = np.array(x_train), np.array(y_train)



    # ML Model

    # from keras.layers import Dense, Dropout, LSTM
    # from keras.models import Sequential
    # from keras.models import load_model


    model = load_model('static\keras_model.h5')


    past_100days = pd.DataFrame(data_training.tail(100))
    past_100days.head()


    final_df = pd.concat([past_100days, data_testing], ignore_index=True)

    input_data = scaler.fit_transform(final_df)


    x_test = []
    y_test = []

    for i in range(100, input_data.shape[0]):

        x_test.append(input_data[i-100:i])
        y_test.append(input_data[i,0])



    x_test, y_test = np.array(x_test), np.array(y_test)
    # print(x_test.shape)
    # print(y_test.shape)


    #making prediction

    y_predict = model.predict(x_test)

    # print(y_predict.shape)



    scaler.scale_
    number = list(scaler.scale_)[0]
    # print(number)



    scale_factor = 1/number
    y_predict = y_predict * scale_factor
    y_test = y_test * scale_factor


    grf_path = 'media\images\\' + name + "predict"
    plt.figure(figsize=(12,6))
    plt.plot(y_test, 'b', label="Original Price")
    plt.plot(y_predict, 'r', label="Predicted Price")
    plt.xlabel("Time")
    plt.ylabel("Price")
    plt.title((name + " Prediction"))
    plt.legend()
    plt.savefig(grf_path)
    plt.clf() 
    # plt.show()



